import React, { useMemo } from 'react';

const DrawingRenderer = ({ drawings, pageNumber, scale = 1, onDrawingClick }) => {
  const pageDrawings = useMemo(() => {
    return drawings.filter(drawing => drawing.pageNumber === pageNumber);
  }, [drawings, pageNumber]);

  const renderDrawing = (drawing) => {
    const { type, data, style } = drawing;
    const { color = '#000000', strokeWidth = 2, opacity = 1 } = style;

    const commonProps = {
      stroke: color,
      strokeWidth: strokeWidth * scale,
      opacity,
      style: { cursor: 'pointer' },
      onClick: (e) => {
        e.stopPropagation();
        onDrawingClick && onDrawingClick(drawing);
      }
    };

    switch (type) {
      case 'freehand':
        if (!data.path || data.path.length < 2) return null;
        const pathData = `M ${data.path[0].x * 100} ${data.path[0].y * 100} ` +
          data.path.slice(1).map(p => `L ${p.x * 100} ${p.y * 100}`).join(' ');
        return (
          <path
            key={drawing.uuid}
            d={pathData}
            fill="none"
            strokeLinecap="round"
            strokeLinejoin="round"
            {...commonProps}
          />
        );
      
      case 'line':
        if (!data.path || data.path.length < 2) return null;
        return (
          <line
            key={drawing.uuid}
            x1={data.path[0].x * 100}
            y1={data.path[0].y * 100}
            x2={data.path[1].x * 100}
            y2={data.path[1].y * 100}
            {...commonProps}
          />
        );
      
      case 'rectangle':
        if (!data.path || data.path.length < 2) return null;
        const rect = {
          x: Math.min(data.path[0].x, data.path[1].x) * 100,
          y: Math.min(data.path[0].y, data.path[1].y) * 100,
          width: Math.abs(data.path[1].x - data.path[0].x) * 100,
          height: Math.abs(data.path[1].y - data.path[0].y) * 100
        };
        return (
          <rect
            key={drawing.uuid}
            x={rect.x}
            y={rect.y}
            width={rect.width}
            height={rect.height}
            fill="none"
            {...commonProps}
          />
        );
      
      case 'circle':
        if (!data.path || data.path.length < 2) return null;
        const radius = Math.sqrt(
          Math.pow((data.path[1].x - data.path[0].x) * 100, 2) +
          Math.pow((data.path[1].y - data.path[0].y) * 100, 2)
        );
        return (
          <circle
            key={drawing.uuid}
            cx={data.path[0].x * 100}
            cy={data.path[0].y * 100}
            r={radius}
            fill="none"
            {...commonProps}
          />
        );
      
      case 'arrow':
        if (!data.path || data.path.length < 2) return null;
        const start = data.path[0];
        const end = data.path[1];
        const angle = Math.atan2((end.y - start.y) * 100, (end.x - start.x) * 100);
        const arrowLength = 10 * scale;
        const arrowAngle = Math.PI / 6;
        
        return (
          <g key={drawing.uuid} {...commonProps}>
            <line
              x1={start.x * 100}
              y1={start.y * 100}
              x2={end.x * 100}
              y2={end.y * 100}
            />
            <path
              d={`M ${end.x * 100} ${end.y * 100} 
                  L ${end.x * 100 - arrowLength * Math.cos(angle - arrowAngle)} ${end.y * 100 - arrowLength * Math.sin(angle - arrowAngle)}
                  M ${end.x * 100} ${end.y * 100}
                  L ${end.x * 100 - arrowLength * Math.cos(angle + arrowAngle)} ${end.y * 100 - arrowLength * Math.sin(angle + arrowAngle)}`}
              fill="none"
            />
          </g>
        );
      
      default:
        return null;
    }
  };

  if (pageDrawings.length === 0) return null;

  return (
    <svg
      className="absolute inset-0 pointer-events-none"
      style={{ width: '100%', height: '100%', zIndex: 15 }}
      viewBox="0 0 100 100"
      preserveAspectRatio="none"
    >
      {pageDrawings.map(renderDrawing)}
    </svg>
  );
};

export default DrawingRenderer;
